import React from "react";
import { Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const PatientDashboard = () => {
  const { logout } = useAuth();

  return (
    <div>
      <header style={{ display: "flex", justifyContent: "space-between", padding: "1rem", backgroundColor: "#f2f2f2" }}>
        <div><strong>Kadaji Hospital</strong></div>
        <button onClick={logout}>Sign Out</button>
      </header>

      <aside style={{ float: "left", width: "200px", padding: "1rem", backgroundColor: "#e0e0e0", height: "100vh" }}>
        <nav>
          <p><Link to="/appointments">Appointments</Link></p>
          <p><Link to="/medical-records">Medical Records</Link></p>
          <p><Link to="/patient">Dashboard</Link></p>
        </nav>
      </aside>

      <main style={{ marginLeft: "220px", padding: "1rem" }}>
        <h2>Patient Dashboard</h2>
        <p>Welcome to your personalized health dashboard.</p>
      </main>
    </div>
  );
};

export default PatientDashboard;
